import { Component } from "react";

export class About extends Component {
  render() {
    return (
      <div className="about">
        <h3>About Us</h3>
        <p>
          NFTium is an American online non-fungible token marketplace
          headquartered in New York City. The company was founded by Joe smoe in
          2017. NFTium offers a marketplace allowing for non-fungible tokens to
          be sold directly at a fixed price, or through an auction.
        </p>
      </div>
    );
  }
}
